INSERT INTO `search_dataset` (`sid`, `type`, `data`, `reindex`) VALUES
(1252, 'node', ' akiko walley akiko walley assistant professor test gmailcom professor walley received her phd from harvard university in 2009 she specializes in japanese buddhist art and archaeology from the 7th and 8th centuries and is currently working on a book manuscript on the bronze shaka triad in the golden hall of horyuji nara japan  english japan wwwgooglecom 2 13 ', 0),
(1253, 'node', ' alan shanks alan shanks i have broad research interests biological oceanography animal behavior intertidal ecology larval biology if i had to point to a general theme to my research i think that it is my fascination with the interaction of the physical realm and the biological much of my work seems to be at the interface between physical and biology oceanography for example much of my present research effort is directed at understanding how the dispersal of larval invertebrates and fish is affected by currents and the behavioral of larvae there is probably a second theme that runs through my work i am strongly driven by my curiosity early in my career i discovered that if i was observant and followed my curiosity i could make novel discoveries through out my career i have tried to pay attention to my observations and serendipity and to actively follow these leads a number of papers have come from this effort when training students undergraduate or graduate one of my primary goals is to persuade them to follow their curiosity as this leads to novel and creative discovers and besides it is fun  afghanistan 2 12  ', 0),
(1254, 'node', ' alan kimball alan kimball  ', 0),
(1255, 'node', ' alejandro vallega alejandro vallega professor vallega works on the fields of latin american philosophy thought decolonial thought continental philosophy phenomenology hermeneutics and deconstruction and aesthetics he has also done extensive work on the history of western philosophy and ancient greek philosophy some of his most pressing concerns are the decolonizing of world philosophies the relationship of latin american thought and continental philosophy the aesthetic elements at work in conceptual thought the prelinguistic experiences that underlie conceptual knowledge the way literature oral traditions and graphic arts occur as thought the reinterpretation of word and image as ciphers for the articulation of human existence in its distinctness and fecundity of meanings and the ways loss silence involuntary memory and nonrepresentational modalities of understanding are at play in the movement and determinations of philosophical thought the aim of his research is the decolonizing of the imaginaries that situate and orient the projection and configuration of conceptual knowledge this through the engagement of the aesthetic experiences that underlie rational understanding in a broader sense his work seeks to enrich in a transformative and critical way the understanding of philosophy and humanism in their limits and possibilities in light of previously excluded ways of beingintheworld in his work profesor vallega interpolates latin american thought and experience with western thought he seeks the development of souhthsouth dialogues and he rethinks out of the concrete excluded knowledges and ways of being such concepts as experience knowledge beauty language history nature the human agency time and space  ', 0),
(1256, 'node', ' aletta biersack aletta biersack  ', 0),
(1257, 'node', ' alex dracobly alex dracobly dracobly has been working on a history of french venereology 18201870 for the last decade he is currently in his sixteenth year of teaching at the university of oregon where he mostly teaches courses on military history both in europe and around the globe he is also the founding director of the uo veterans oral history project an ongoing effort to document and archive the experiences of student veterans of the iraq and afghanistan wars at the university of oregon  ', 0),
(1258, 'node', ' alexander mathas alexander mathas maths is working on a book that focuses on how german writers from different periods since 1750 have engaged with scientific and philosophical ideas about what defines a human being the interest in defining the human coincides with a flowering of german literature and the rediscovery of humanism at the end of the 18th century like the original humanism of the renaissance german neohumanism is associated with the rediscovery of greek aesthetics and the emancipation of the individual writers were consciously paying tribute to greek culture and its artifacts as harmonious manifestations of a wellrounded human being in their view the call for the emancipation of the individual had been answered in the distant past and the art that it produced became a witness in the struggle for the liberation of the bourgeois citizen although this type of humanism has often been portrayed as a form of art that is above and beyond politics it has had farreaching political implications by analyzing exemplary literary and theoretical texts from different periods and authors the study shows that humanist ideas were far from timeless it examines how these ideas were used to promote periodspecific aesthetic philosophical and ideological agendas  ', 0),
(1259, 'node', ' alexander b murphy alexander b murphy assistant professor murphy specializes in the political and cultural geography of europe and the middle east his research focuses on three themes 1 the ways in which the political organization of territory reflects and shapes patterns of ethnonational identity 2 the changing politicalterritorial order in europe in the wake of integration and 3 the geographical assumptions that undergird different geopolitical ideas about the middle east he has studied such issues as the impact of the partitioning of belgium along language lines on senses of flemish and walloon identity the ways in which transboundary cooperation agreements in europe influence perceptions of cultural continuity and difference and the ways in which particular political geographic ideas and assumptions shape decisions in the international arena eg the decision in europe to adopt a common currency or the decision in the united states to intervene militarily in iraq he has also written widely on the nature of geography as a discipline and the insights that geographical perspectives can offer in the effort to confront contemporary political social and environmental challenges 2 15 university of oregon architecture university of oregon architecture 1 234 university of oregon architecture anguilla 1 234  ', 0),
(1260, 'node', ' alexandra bonds alexandra bonds in 19901991 bonds received a fulbright appointment to teach costume design at the national institute for the arts now the taipei national university of the arts in taiwan during this year the school celebrated its move from luchow to a new campus in guandu and she designed eight superpuppets for this celebration based on taoist rituals during festivities lasting for six months the students and faculty created performances based on the history of the institute partook in the commemoration of the birthday of matsu goddess of the sea and culminated the year with a twoday parade and pilgrimage from the old campus to the new the year in taiwan inspired her research interests in chinese performance and influenced her book entitled beijing opera costumes the visual communication of character and culture which was recently published by the university of hawaii press research for the book was conducted in taipei beijing and honolulu hawaii the book is the first englishlanguage indepth analysis of the theory and practice of dress in this traditional performance style bonds has lectured nationally and internationally on this subject and her research efforts have twice been recognized with awards for excellence in writing for the performing arts  ', 0),
(1261, 'node', ' alexandre albertgaltier alexandre albertgaltier  ', 0),
(1262, 'node', ' alfredo burlando alfredo burlando burlando current research focuses on the interaction between formal financial markets and informal risk sharing networks in east africa with ongoing projects on mobile money in tanzania and savings groups in uganda his past work includes an examination of the impact of infrastructure development on health and fertility in tanzania he also works on theories that explore the implications of drug legalization on police corruption japan ', 0),
(1263, 'node', ' alisa freedman alisa freedman japan ', 0),
(1264, 'node', ' alison gash alison gash  ', 0),
